description:
I found an english-translated work that I didn\&amp;#039;t have yet, by the japanese artist Akari Tsutsumi , on the site of an IRL friend, and that gave me the idea to gather all of that drawer\&amp;#039;s known works, with my friend\&amp;#039;s cooperation. He will later on post them on his blog, but he has no objection to me sharing it first.

Style : big tits and awesome titwork, sister incest, a bit of maids and schoolgirls and school teachers.
